pragma solidity >=0.4.25 <0.6.0;

contract MethMain {

    // ForeignBridge foreignBridge; TODO: попробовать как интерфейс
    // BurrowPart burrowPart; TODO: попробовать как интерфейс

    uint256 public i;

    event ChangeValue(address currentContract, uint256 value);
    event RequestForChangeValue(address contractSender, address _burrowContract, bytes encodedData);

    function setValue(uint256 _i) public {

        i = _i;

        emit ChangeValue(address(this), i);
    }

    function getValue() public view returns(uint256) {
        return i;
    }

    function setValueInBurrow(address burrowPart, uint256 _i) public {

        /// @dev 4byte сигнатуры метода, который вызываем
        // bytes4 methodSelector = "ContractOnForeign(0).setValue.selector";
        bytes4 methodSelector = 0x55241077; // TODO: получить 4 байта сигнатуры у методов контракта в Burrow

        /// @dev данные, которые передаем в метод
        i = _i;

        /// @dev кодируем данные для передачи в другую сеть
        bytes memory encodedData = abi.encodeWithSelector(methodSelector, _i);

        /// @dev вызываем событие, которое будет отловлено мостом
        emit RequestForChangeValue(msg.sender, burrowPart, encodedData);
    }

    function getValueInBurrow(address burrowPart) public returns(uint256) {

        /// @dev 4byte сигнатуры метода, который вызываем
        // bytes4 methodSelector = "ContractOnForeign(0).setValue.selector";
        bytes4 methodSelector = 0x8fe94fb2; // TODO: получить 4 байта сигнатуры у методов контракта в Burrow

        bytes memory encodedData = abi.encodeWithSelector(methodSelector);
        emit RequestForChangeValue(msg.sender, burrowPart, encodedData);

        return i;
    }

}
